Selling an unfired Nemesis Vanquish with .308 and .243 Win barrels. This is a low serial Windrunner model. Please see below for what is included:

Nemesis Windrunner Rifle;
Factory .308 Barrel and .243 Winchester barrel with muzzles;
.243 barrel dust cap;
Retractable factory stock;
Factory AR adapter;
DPMS Ironstone Match Stock with Adjustable length of pull, weight, etc. (Cerakoted);
Factory default bolt handle AND factory Large bolt handle;
Bolt professionally CeraSlick coated;
Factory default weaver aluminum 0 MOA Rail AND custom milled Nightforce picatinny steel 20 MOA rail;
Factory Bipod & pin;
Factory Tri-Rail fore grip;
4 Factory 5 round magazines;
Delrin caps for barrel lock and receiver;
Factory tactical backpack;
Pelican case with cut foam (I cut the foam, so it's not perfect);
Owners manual.

This is a fantastic rifle! Only wear is from be moved around the safe. 1/2 MOA verified out to 200 yards after removing barrel. DOES NOT COME WITH SCOPE, SCOPE MOUNT OR BIPOD shown in picture, but does come with factory bipod and pin. Both barrels are unfired... I bought the 308 from the original owner who never fired it.
MSRP for everything you get and the custom work is well over $7500, plus tax... no tax with me and a great rare gun for well under retail! Could be open to trades for gun or group of guns that has a retail value close to what mine is.... would consider other precision bolt actions, FN guns (SCAR, FNAR, Five Seven, FS2000, PS90), or high end AR10 platforms such as POF. So if you have a package that comes somewhere in the range of $7500, let me know and we can talk. Shipping is $100 paid by buyer.
Thanks!
